شرطي اسرائيلي يخنق طفلا فلسطينيا حتى الموت خلال مظاهرة امام السفارة الامريكية في القدس .
الصبي البريء قرأ "كلمة الشهادة" قبل وفاته .. وعلى الرغم من المحاولات العديدة التي قامت بها المجموعات لتنزيل هذا الڤيديو على Youtube ، إلا أن المقطع كان يتم إزالته بشكل منهجي
